import React from 'react';
import Map from './Map';

const App: React.FC = () => {
  return (
    <div>
      {/* Header */}
      <div className="">
        <div>
          <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>TAYLOR SWIFT: THE ERAS TOUR</h1>
          <h1 style={{ fontFamily: 'era', textAlign: 'center' }}>Eras Tour Tracker</h1>
        </div>
      </div>

      <div className="flex flex-col md:flex-row m-10" style={{ backgroundColor: 'whitesmoke' }}>
        <div className="m-10 p-5 bg-white shadow-md">
          <Map />
          <div className="flex items-center mt-4">
            <div className="w-4 h-4 bg-red-500 mr-2"></div>
            <span>Red - Tour Locations</span>
          </div>
          <div className="flex items-center mt-2">
            <div className="w-4 h-4 bg-blue-500 mr-2"></div>
            <span>Blue - Future Locations</span>
          </div>
          <div className="flex items-center mt-2">
            <div className="w-4 h-4 bg-green-500 mr-2"></div>
            <span>Green - Completed Locations</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
